import React from 'react';
import '../css/Home.css';

function Home() {
    return (
        <div className="home">
            <div className="home-content">
                <p>find your next new track...</p>
                <button className="discover-btn">discover now</button>
            </div>
        </div>
    );
}

export default Home;
